    let aliases = ["Infrastruc", "Type", "Year of in", "Coordinate", "Remarks", "lat", "lon"];

        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
